import React from 'react';

function Hero() {
  return (
    <section className="hero">
      <div className="hero-overlay">
        <h1>Helping You Buy & Sell in Ottawa</h1>
        <p>With Lei Guo</p>
        <div className="hero-buttons">
          <button>Sell with Lei</button>
          <button>Buy with Lei</button>
        </div>
      </div>
    </section>
  );
}

export default Hero;
